def dijkstra(graph, start, end):
 # Initialize distances and visited sets
 distances = {node: float('inf') for node in graph}
 distances[start] = 0
 visited = set()

 # Loop until all nodes are visited or the end is found
 while len(visited) < len(graph):
   # Find the node with the smallest distance that has not been visited
   min_node = None
   for node in graph:
     if node not in visited and (min_node is None or distances[node] < distances[min_node]):
       min_node = node

   # Mark the node as visited and update the distances of its neighbors
   visited.add(min_node)
   for neighbor, weight in graph[min_node].items():
     if neighbor not in visited:
       distances[neighbor] = min(distances[neighbor], distances[min_node] + weight)

 # Return the distance to the end or None if no path exists
 return distances[end] if end in distances else None

