// Initialize the priority queue with the starting node
PriorityQueue<Integer> queue = new PriorityQueue<>();
queue.add(startingNode);

// Loop until the queue is empty
while (!queue.isEmpty()) {
    // Extract the node with the minimum priority from the queue
    int currentNode = queue.poll();

    // Update the distances of its neighbors
    for (int neighbor : graph.getNeighbors(currentNode)) {
        if (distances[neighbor] > distances[currentNode] + 1) {
            distances[neighbor] = distances[currentNode] + 1;
            queue.add(neighbor);
        }
    }
}

// Find the shortest path between the starting and ending nodes
